pragma solidity 0.8.20;

/**
 * @title Errors library
 * @notice Defines the error messages emitted by the different contracts of the  protocol
 */
library Errors {
  string public constant ZERO_ADDRESS_NOT_VALID = '1'; // 'Zero address not valid'
  string public constant CANT_RENOUNCE_OWNERSHIP = '2'; // 'Can't renounce ownership'
  string public constant CONFIG_SUPPORT_ASEETS = '3'; // 'Config sales contract support assets'
  string public constant INVALID_CUSTODIAN_ADDRESS = '4'; // 'Invalid custodian address'
  string public constant INVALID_ASSET_ADDRESS = '5'; // 'Invalid asset address'
  string public constant INVALID_FEE_RATE = '6'; // 'Fee rate must be greater than 0 and less than 1e5'
  string public constant ZERO_AMOUNT_NOT_VALID = '7'; // 'Zero amount not valid'
  string public constant INVALID_ROUTE = '8'; // 'Invalid route'
  string public constant INVALID_TOKEN = '9'; // 'Invalid token'
  string public constant INVALID_COOLDOWN = '10'; // 'Invalid cooldown'
  string public constant EXCESSIVE_REDEEM_AMOUNT = '11'; // 'Excessive redeem amount'
  string public constant INVALID_AMOUNT = '12'; // 'Invalid amount'
  string public constant COOLDOWN_NOT_OVER = '13'; // 'Cooldown not over'
  string public constant MIN_REDEEM_VIOLATION = '14'; // 'Min redeem violation'
}
